import json
import re

with open('/Users/imorgado/LOOKSMAXX/FACEIQPAID/b4ddc3c6-8702-4c39-8400-b68071bf91d6/comprehensive_library.json', 'r') as f:
    data = json.load(f)

keywords = ['turkey', 'korea', 'thailand', 'brazil', 'mexico', 'medical tourism', 'destination', 'country', 'region', 'international', 'abroad', 'cost in', 'price in', 'USD', 'EUR', 'GBP']

print("Searching all text fields for location/pricing keywords...\n")

matches = []

for proc_id, proc_data in data.items():
    proc_str = json.dumps(proc_data, default=str).lower()

    for keyword in keywords:
        if keyword in proc_str:
            matches.append((proc_id, keyword))
            break

if matches:
    print(f"Procedures mentioning locations/regions ({len(matches)}):")
    for proc_id, keyword in matches[:20]:
        print(f"  {proc_id}: mentions '{keyword}'")
else:
    print("No procedures found with location/tourism keywords")

# Check if cost notes contain any location info
print("\n\nChecking cost notes for location patterns:\n")

for proc_id, proc_data in list(data.items())[:200]:
    if isinstance(proc_data, dict) and 'details' in proc_data:
        details = proc_data['details']
        if isinstance(details, dict) and 'advice' in details:
            advice = details['advice']
            if isinstance(advice, dict):
                cost = advice.get('cost', {})
                notes = cost.get('notes', '') if isinstance(cost, dict) else ''
                if notes and any(term in str(notes).lower() for term in ['country', 'region', 'location', 'international', 'turkey', 'korea', 'thailand']):
                    print(f"{proc_id}: {notes}")

