python3 << 'EOF'
import json

with open('/Users/imorgado/LOOKSMAXX/FACEIQPAID/b4ddc3c6-8702-4c39-8400-b68071bf91d6/harmony_data.json', 'r') as f:
    data = json.load(f)

# Find all instances of "region"
def find_region_refs(obj, path=""):
    results = []
    if isinstance(obj, dict):
        for key, value in obj.items():
            if 'region' in key.lower():
                results.append((path + "." + key if path else key, value))
            results.extend(find_region_refs(value, path + "." + key if path else key))
    elif isinstance(obj, list):
        for i, item in enumerate(obj):
            results.extend(find_region_refs(item, f"{path}[{i}]"))
    elif isinstance(obj, str) and 'region' in obj.lower():
        results.append((path, obj))
    return results

refs = find_region_refs(data)

print(f"Found {len(refs)} region references in harmony_data.json:\n")

for path, value in refs[:30]:
    print(f"Path: {path}")
    if isinstance(value, (dict, list)):
        print(f"Value: {json.dumps(value, indent=2, default=str)[:300]}")
    else:
        print(f"Value: {value}")
    print()

# Also check top-level structure
print("\n\nTop-level keys in harmony_data.json:")
if isinstance(data, dict):
    for key in list(data.keys())[:20]:
        val = data[key]
        print(f"  {key}: {type(val).__name__}", end="")
        if isinstance(val, dict):
            print(f" ({len(val)} items)")
        elif isinstance(val, list):
            print(f" ({len(val)} items)")
        else:
            print()

